import { NavLink } from "react-router-dom";
import classes from "./Navbar.module.css"
const Navbar = () => {
  return (
    <nav className={classes.nav}>

        <NavLink to="/profile">Profile</NavLink>
        <NavLink to="/dialogs">Messages</NavLink>

    </nav>
  );
};

export default Navbar;
